async function setDateRange(a,e){try{let t=FLD[a].DateRange,r=FLD[a].StartDate,n="StartTime"in FLD[a]?FLD[a].StartTime:FLD[a].StartDate,i=FLD[a].EndDate,u="EndTime"in FLD[a]?FLD[a].EndTime:FLD[a].EndDate;return updateData={[t]:{date:e[`${r}_raw`].date,hours:e[`${r}_raw`].hours,minutes:e[`${n}_raw`].minutes,am_pm:e[`${n}_raw`].am_pm,to:{date:e[`${i}_raw`].date,hours:e[`${i}_raw`].hours,minutes:e[`${u}_raw`].minutes,am_pm:e[`${u}_raw`].am_pm}}},await db(a).key(e.id).update(updateData)}catch(a){return Promise.reject(a)}}async function updateTripRange(a){return setDateRange(TBL.Trips,a)}async function updateScheduleRange(a){let e=setDateRange(TBL.Schedules,a),t=updateTripRange((await db(TBL.Trips).key(sub(a,FLD.Schedules.Trip,"id")).get()).data[0]);return await Promise.all([e,t])}